// ... (your imports)
import { Button, Card, Row } from "react-bootstrap";
import { useNavigate } from "react-router";
import { Link } from "react-router-dom";
import Navbarcomponent from "../navbar";

function CartComponent({ cart, setCart }) {
  const navigate = useNavigate();

  const handleButtonClick = () => {
    // Navigate to the booking page
    navigate("/booking");
  };

  // Calculate total price
  const totalPrice = cart.reduce((sum, book) => sum + book.bookPrice * book.quantity, 0);

  return (
    <div>
      <div>
        <Navbarcomponent />
      </div>

      <br />
      <h2>Cart</h2>
      <br />
      <br />
      <br />
      <br />
      <div className="container col-md-8">
        <Row>
          {cart.map((b, index) => (
            <div key={index} className="col-md-4 mb-4">
              <Card
                style={{
                  width: '400px',
                  backgroundColor: '#your_card_background_color_here',
                }}
              >
                <Card.Body
                  style={{
                    backgroundColor: '#your_card_body_background_color_here',
                  }}
                >
                  <Link to={'/books?id=' + b.id}>
                    <Card.Title>{b.bookTitle}</Card.Title>
                  </Link>
                  <hr />
                  <div>
                    <div
                      style={{
                        display: 'flex',
                        flexDirection: 'column',
                        marginBottom: '10px',
                      }}
                    >
                      <div>
                        <span style={{ fontWeight: 'bold' }}>Rating:</span>{' '}
                        {b.rating}
                      </div>
                      <div>
                        <span style={{ fontWeight: 'bold' }}>Author:</span>
                        <Link to={'/authors?id=' + b.id}>{b.author}</Link>
                      </div>
                      <div>
                        <span style={{ fontWeight: 'bold' }}>Category:</span>{' '}
                        {b.category.name}
                      </div>
                      <div>
                        <span style={{ fontWeight: 'bold' }}>Price:</span>{' '}
                        {b.bookPrice}
                      </div>
                      <Button
                        onClick={() =>
                          setCart((prevCart) =>
                            prevCart.filter((item) => item.id !== b.id)
                          )
                        }
                      >
                        Remove from Cart
                      </Button>
                      <span style={{ margin: '0 5px' }}>{b.quantity}</span>
                    </div>
                  </div>
                </Card.Body>
              </Card>
            </div>
          ))}
          <div class="page-content page-container" id="page-content">
            <div class="padding">
              <div class="row container d-flex justify-content-center">
                <div>
                  <br />
                  {/* Display total price here */}
                  <span style={{ fontWeight: 'bold' }}>Total Price: </span>{' '}
                  {totalPrice}
                </div>
                <button
                  type="button"
                  onClick={handleButtonClick}
                  class="btn btn-success btn-icon-text bouncebutton"
                  style={{ fontSize: '30px' }}
                >
                  <i class="fa fa-check btn-icon-prepend"></i>Proceed to Buy
                </button>
              </div>
            </div>
          </div>
        </Row>
      </div>
    </div>
  );
}

export default CartComponent;
